import React, { Component } from "react";

class Contact extends Component {
  render() {
    return (
      <div>
        <h2>Contact</h2>
        <p>Email: info@email.com <br />
           Phone: 002938293089
</p>
      </div>
    );
  }
}

export default Contact;
